document.getElementById("hamburger-menu").onclick=function(){var e=document.getElementsByClassName("hide-mobile"),m=document.getElementById("hamburger-menu");if("hamburger-menu"==m.className){m.className="hamburger-clicked";for(var a=0;a<e.length;a++)e[a].style.display="block"}else{m.className="hamburger-menu";for(var l=0;l<e.length;l++)e[l].style.display="none"}};